import {
  AppBar,
  Box,
  Container,
  CssBaseline,
  Divider,
  Drawer,
  Grid,
  IconButton,
  List,
  Paper,
  Toolbar,
  Typography,
} from "@mui/material";
import React from "react";
import { FlexRowCenter, GreenBox } from "../elements";

function Dashboard(props) {
  return (
    <>
      <Box sx={{ display: "flex" }}>
        <CssBaseline />
        <AppBar position="absolute">
          <Toolbar
            sx={{
              pr: "24px", // keep right padding when drawer closed
            }}
          >
            <IconButton
              edge="start"
              color="inherit"
              aria-label="open drawer"
              sx={{
                marginRight: "36px",
              }}
            >
              {/* <MenuIcon /> */}
            </IconButton>
            <Typography
              component="h1"
              variant="h6"
              color="inherit"
              noWrap
              sx={{ flexGrow: 1 }}
            >
              Dashboard
            </Typography>
            <IconButton color="inherit">
              {/* <Badge badgeContent={4} color="secondary">
                <NotificationsIcon />
              </Badge> */}
            </IconButton>
          </Toolbar>
        </AppBar>

        <FlexRowCenter
          mt={2}
          sx={{
            flexGrow: 1,
            height: "100vh",
            overflow: "auto",
          }}
        >
          <Container maxWidth="lg" sx={{ mt: 5, mb: 4 }}>
            <Grid container spacing={3}>
              <Grid item xs={6} md={4} lg={4}>
                <GreenBox>abc</GreenBox>
              </Grid>
              <Grid item xs={6} md={4} lg={4}>
                <GreenBox>abc</GreenBox>
              </Grid>
              <Grid item xs={6} md={4} lg={4}>
                <GreenBox>abc</GreenBox>
              </Grid>
            </Grid>
            {/* <Copyright sx={{ pt: 4 }} /> */}
          </Container>
        </FlexRowCenter>
      </Box>
    </>
  );
}

export default Dashboard;
